import React, { useState } from "react";
import "./main.css";
import "./keywords.css";

function Keyword() {
  const [keyword, setKeyword] = useState("");

  const handleChange = (event) => {
    setKeyword(event.target.value);
  };

  const handleSelect = (word) => {
    setKeyword(word);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    if (keyword.trim() === "") {
      alert("⚠️ Please enter a keyword!");
      return;
    }
    alert(`🎵 Your keyword: "${keyword}"`);
  };

  return (
    <div>
      <h1 className="top-heading">
        <img
          src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
          width="50"
          height="55"
          alt="MoodMelody Logo"
        />{" "}
        MoodMelody
      </h1>

      <blockquote className="styled-quote">
        <p>
          <img
            src={`${process.env.PUBLIC_URL}/fyp-images/movie.webp`}
            width="35"
            height="30"
            alt="Mood Icon"
            className="movie"
          />
          From Moments to Melodies — Create Stories from Your Videos...
        </p>
      </blockquote>

      <h2 className="main-heading">Add Your Inspiration Keyword</h2>

      <form className="keyword-form" onSubmit={handleSubmit}>
        {/* Input box */}
        <input
          type="text"
          className="keyword-input"
          placeholder="Enter a word that captures your video (e.g., adventure, peace...)"
          value={keyword}
          onChange={handleChange}
        />

        {/* ✅ Suggestions BELOW input box */}
        <div className="keyword-suggestions">
          <div className="row">
            <div className="col" onClick={() => handleSelect("Adventure")}>
               <img
            src={`${process.env.PUBLIC_URL}/fyp-images/adventure.jpg`}
            width="35"
            height="30"
            alt="Mood Icon"
            className="icons"
          />
              Adventure
            </div>
            <div className="col" onClick={() => handleSelect("love")}> <img
            src={`${process.env.PUBLIC_URL}/fyp-images/love.jpg`}
            width="35"
            height="30"
            alt="Mood Icon"
            className="icons"
          />
              Love
            </div>
            <div className="col" onClick={() => handleSelect("Freedom")}> <img
            src={`${process.env.PUBLIC_URL}/fyp-images/freedom.png`}
            width="35"
            height="35"
            alt="Mood Icon"
            className="icons"
          />
              Freedom
            </div>
            <div className="col" onClick={() => handleSelect("Mystery")}> <img
            src={`${process.env.PUBLIC_URL}/fyp-images/mystery.png`}
            width="35"
            height="35"
            alt="Mood Icon"
            className="icons"
          />
              Mystery
            </div>
          </div>
          <div className="row-2">
            <div className="col" onClick={() => handleSelect("joy")}> <img
            src={`${process.env.PUBLIC_URL}/fyp-images/joy.webp`}
            width="35"
            height="30"
            alt="Mood Icon"
            className="icons"
          />Joy
            </div>
            <div className="col" onClick={() => handleSelect("peace")}> <img
            src={`${process.env.PUBLIC_URL}/fyp-images/peace.jpeg`}
            width="35"
            height="30"
            alt="Mood Icon"
            className="icons"
          />peace
            </div>
            <div className="col" onClick={() => handleSelect("Memories")}> <img
            src={`${process.env.PUBLIC_URL}/fyp-images/dreams.jpeg`}
            width="35"
            height="30"
            alt="Mood Icon"
            className="icons"
          />Memories
            </div>
          </div>
        </div>

        {/* Submit button */}
        <button type="submit" className="keyword-btn">
          Submit
        </button>
      </form>
    </div>
  );
}

export default Keyword;
